import React, { Component } from 'react';
import './App.css';

class App extends Component {
  constructor() {
    super();
    this.state = {
      img:[],
    };
  }



  render() {
    return(
      <>
        <div class="content">
          <i className="fa fa-arrow-left left-icon"></i>
          <img class="image" alt="backgroundImage"/>
          <i className="fa fa-arrow-right right-icon"></i>
        </div>
      </>
    );
  }
}

export default App;
